import { useSelector } from "react-redux"

function FilterBar(){
    const genres = useSelector(initialState => initialState.gamesGenres)

    return(
        <nav>
            <ul>
                {genres.map(each => {
                    return(<li>{each}</li>)
                })}
            </ul>
        </nav>
    )
}

export default FilterBar
